import React from 'react';
import './Items.css';


function Items(props) {
    return (
      <div className="addnew-item">
      <Item key={index} item={value} onItemClick={props.onItemClick} onDeleteItem={props.onDeleteItem} ></Item>
          <div className="todo-item-date">
              <span className="day">{props.items.date}</span>
              <span className="month">{props.items.date}</span>
          </div>
          <div className="todo-item-content">
              <span className="data">{props.items.content}</span>
          </div>
          <span className="delete-btn" title="delete" onClick={(e) => {
              e.stopPropagation();
              props.onDeleteItem(props.items);
          }}></span>
      </div>
    );
}

export default Items;
